(140, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/03/wordpress-4-7-3-security-and-maintenance-release/''>WordPress 4.7.3 Security and Maintenance Release</a> <span class="rss-date">March 6, 2017</span><div class="rssSummary">WordPress 4.7.3 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.2 and earlier are affected by six security issues: Cross-site scripting (XSS) via media file metadata.  Reported by Chris Andrè Dale, Yorick Koster, and Simon P. Briggs. Control characters can trick redirect [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wptavern.com/wpweekly-episode-268-behind-the-scenes-of-wordpress-development-course-up-and-running-second-edition''>WPTavern: WPWeekly Episode 268 – Behind the Scenes of WordPress Development Course, Up and Running Second Edition</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/godaddy-acquires-sucuri''>WPTavern: GoDaddy Acquires Sucuri</a></li><li><a class=''rsswidget'' href=''https://buddypress.org/2017/03/buddypress-at-wordcamp-london-2017-contributor-day/''>BuddyPress: BuddyPress at WordCamp London 2017 Contributor Day</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> SiteOrigin Widgets Bundle&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=so-widgets-bundle&amp;_wpnonce=56d2d33490&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install SiteOrigin Widgets Bundle">(Install)</a></li></ul></div>', 'no'),
